import React from "react";
import "./style.css";

function Jumbotron() {
  return (
    <div className="jumbotron text-center">
      <h1>MAPA</h1>
      <a target="_blank" rel="noopener noreferrer" href="./map.html" className="link">
        It's all about that Map!
      </a>
    </div>
  );
}

export default Jumbotron;
